import React from 'react';
import { withData } from './withData'

const Speakers = ({ speakers }) => {


    return (
        <div>
            {speakers.map(speaker => <p>{speaker.name}</p>)}
        </div>
    );
}

const EnhancedSpeakerComponent = withData(Speakers);
export default EnhancedSpeakerComponent;
